import { Component, Input } from '@angular/core';
import datajson from '../../assets/tables.json';


@Component({
  selector: 'app-top-destination',
  templateUrl: './top-destination.component.html',
  styleUrls: ['./top-destination.component.css']
})
export class TopDestinationComponent {
@Input() data : any;
ngOnInit():void{
  this.data = datajson;
}

}
<div class="container">
    <h1>Top Destination</h1>
    <div class="row">
       <p> {{data['Destination'].name}}</p>
       <p>hoo2</p>
        <div class="col" *ngFor="let dest of data['Destination'] ;let i =index"> 
            <app-img-card [destination]="dest"></app-img-card>
        </div>

    </div>

</div>
